import "./styles.css";
import "./mandik.css";
import {Routes,Route,useParams} from "react-router-dom";
import {useEffect} from "react";
import axios from "axios";
import Header from "./components/header";
import Sports from "./components/sports";
import Shoes from "./components/shoes";
import GymEssentials from "./components/gym";
import Supplements from "./components/supplements";
import FoodAndDrinks from "./components/foodanddrink";
import Cart from "./components/cart";
import WishList from "./components/wishlist";
import Home from "./components/Home"


function Product()
{
  const {id} = useParams();
  console.log(id);
  useEffect(async()=>
  {
    const {data} = await axios.get("http://localhost:5000/api/products/"+"607d261aaa8bd580c4c95a55");
    console.log(data)

  })
  return(
    <h1>Products</h1>
  )
}

export default function App() {

  return (
    <div>
     <Header />
      
      <Routes>
     
        <Route path="/" element={<Home/>}/>
        <Route path="/sports" element={<Sports />} />
        <Route path="/shoes" element={<Shoes />} />
        <Route path="/gym" element={ <GymEssentials />} />
        <Route path="/supplements" element={<Supplements />} />
        <Route path="/foodanddrink" element={<FoodAndDrinks />} />
        <Route path="/cart" element={<Cart />} />
        <Route path="/wishlist" element={<WishList />} />
        <Route path="/products/:id" element={<Product/>} />
      </Routes>

    </div>
  );
}
